/* Validate list order
 */
function validateItemOrder(itemList, columnSelector, expectedOrder) {

    // columnSelector (string or index)
    let index = 0;
    let column_names = Object.keys(itemList);
    let column_values = [];
    column_names.forEach((column_name) => {
        if (column_name === columnSelector || index++ === columnSelector)
            column_values = itemList[column_name];
    });

    let order;
    if (expectedOrder.toUpperCase() === "DESCENDING") {
        order = column_values.slice(1).every((item, i) => {
            if (!isNaN(column_values[i]) && !isNaN(item)) {
                // Numeric comparison
                return Number(column_values[i]) >= Number(item);
            } else {
                // Case-insensitive lexical comparison
                return column_values[i].toLowerCase() >= item.toLowerCase();
            }
        });
    } else {
        order = column_values.slice(1).every((item, i) => {
            if (!isNaN(column_values[i]) && !isNaN(item)) {
                // Numeric comparison
                return Number(column_values[i]) <= Number(item);
            } else {
                // Case-insensitive lexical comparison
                return column_values[i].toLowerCase() <= item.toLowerCase();
            }
        });
    }

    if (!order)
        throw new Error("Options are NOT in " + expectedOrder + " order: \n" + JSON.stringify(column_values, null, 2));

}

